def fun_factorial(num):
  if num<0:
    print('Factorial does not exist for neagtive numbers')
  else:
    factorial=1
    for i in range(num,0,-1):
      #print(i)
      factorial=factorial*i
    print('factorial of ',num,'is ',factorial)

