def check_armstrong(num):
  num1=num2=num
  digit=1
  while num1>10:
    digit=digit+1
    num1=num1//10
    #print(num)
    #print(digit)
  armstrong=0
  while num2>0:
    armstrong=armstrong+(num2%10)**digit
    num2=num2//10
  if num==armstrong:
    return True
  else:
    return False

print(check_armstrong(1634))
print(check_armstrong(1234))
print(check_armstrong(54748))

