def is_palindrome(num):
  #for counting the digit
  num2=num1=num
  digit=1
  while num1>10:
    digit=digit+1
    num1=num1//10

  #for reversing the number
  rev=0
  while num2>0:
    digit=digit-1
    rev=rev+((num2%10)*10**digit)
    num2=num2//10
  #print(rev)
  if rev==num:
    return True
  else:
    return False

is_palindrome(123321)



