def combinations(word,prefix=''):
  if len(word) == 0:
    print(prefix)
  else:
    for i in range(len(word)):
      new_word = word[:i] + word[i+1:]
      print(new_word)
      new_prefix = prefix + word[i]
      print(new_prefix)
      combinations(new_word, new_prefix)
      print('=================')
